import React from 'react';
const name = 'Therapy';
const image1 = 'https://picsum.photos/200/300';

const Attribute=()=>{
return(<>
<h1 contentEditable= "yes">Visit our website to know more about {name}</h1>
<img src={image1} alt="random images"/>
</>
)
}

export default Attribute;
